    public static void addOverride(String legacyKey, String modernBlock) {
        LEGACY_TO_MODERN.put(legacyKey, modernBlock);
        SchematicLoader.get().getLogger().atInfo().log("Legacy Override set: "+legacyKey+" -> "+modernBlock);
    }

    public static String getModernBlock(int blockId, int blockData) {
        String key = blockId + ":" + blockData;
        if(blockData == -1)
            key = String.valueOf(blockId);

        if(!LEGACY_TO_MODERN.containsKey(key))
        {
            return LEGACY_TO_MODERN.getOrDefault(String.valueOf(blockId),"minecraft:stone");
        }
        else
            return LEGACY_TO_MODERN.get(key);
    }

    public static boolean isValidBlock(int blockId, int blockData) {
        String key = blockId + ":" + blockData;
        if(blockData == -1)
            key = String.valueOf(blockId);
        if(!LEGACY_TO_MODERN.containsKey(key))
        {
            return LEGACY_TO_MODERN.containsKey(String.valueOf(blockId));
        }
        else
            return true;
    }

    public static boolean dataIsRotation(int blockId, int data) {
        String key = blockId + ":" + data;
        if(data == -1)
            key = String.valueOf(blockId);
        if(!LEGACY_TO_MODERN.containsKey(key))
        {
            return LEGACY_TO_MODERN.containsKey(String.valueOf(blockId));
        }
        else
            return false;
    }
